  const getDonasi = async () => {
    try {
      const data = await fetcher(`${API_URL}/api/fundraiser/donations`, {
        method: 'GET',
      })
      const response = await data.data
      setData(response)
      setLoading(true)
    } catch (err) {
      if (err?.status > 400) {
        history.push('/')
      }
    }
  }

